import React from "react";
export function SubjectItem(props) {
  return (
    <div
      className="App-header-item"
      onClick={() => {
        props.setHome(false);
        props.setSubject(true);
        props.setPage(props.subjectTitle);
      }}
    >
      <img
        className={`App-header-${props.class}-img`}
        src={props.imgUrl}
        alt="icon"
      />
      <div className={`App-header-${props.class}-label`}>
        {props.subjectTitle}
      </div>
    </div>
  );
}
